script: |
  super -f text -I q5832.spq | sort > q5832.out

inputs:
  - name: q5832.spq
    data: |
      SELECT - 60 * + col1 + + col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE ( + col1 + + CAST ( 80 AS INTEGER ) ) BETWEEN - col1 AND ( + col2 * - CAST ( col0 * + 19 AS REAL ) );
  - name: tab1

outputs:
  - name: q5832.out
    data: |
